{
  "TotalDamages": 162000,
  "StartTime": "2007-03-31T16:29:00.0000000Z",
  "EndTime": "2007-03-31T16:37:00.0000000Z",
  "Details": {
    "Description": "This tornado began 5.4 miles north of Delaware, in Delaware county, at about 429 pm CST, and crossed into Clayton county 6 miles east of Edgewood at approximately 437 pm CST. The tornado was rated EF1 (NWS storm survey team), moved north-northeast at 50 mph, and had a total path length of 10 miles and was 200 yards wide. The tornado struck eight farmsteads in Delaware county, producing mostly minor damage to outbuildings and trees. However, at a farm southeast of Greeley, EF1 damage occurred with winds estimated at 81 mph. A dairy barn collapsed, trapping two people that were milking cows under the debris. They were rescued unharmed, but 24 cows were killed. A two-car garage was completely blown off its foundation, but the house next to it had little damage. An eyewitness just southwest of this farmstead reported seeing rotation in the clouds as it descended and struck the dairy barn. Near the Delaware-Clayton county line, a narrow swath of considerable tree damage was noted, with debris carried up a hillside and spread across a road. Path length in Delaware county was more than 7 miles, and damage was estimated at $162,000.|",
    "Location": "IOWA"
  }
}

