  "Details": {
    "Description": "The tornado initially touched down south of the intersection of Flora Place and South 39th Street.  Several trees were damaged in this location.  The tornado traveled to the northeast and caused additional large tree limb damage east of the intersection of Shaw Boulevard and South 39th Street.  The tornado lifted and traveled over I-44 and then dropped back down on Blaine Avenue causing partial roof damage to three homes just west of South Grand Blvd.  The tornado briefly lifted again...then came back down at the Saint Louis University Medical Center causing minor roof damage to one building and blew out a number of windows at two parking garages east of South Grand Blvd on the medical campus.  A large lamp post and several large tree limbs were blown down in this location as well.  The tornado lifted again and then touched down one last time damaging a large billboard west of the intersection of I-64 and Jefferson Avenue.  Two people driving on I-64 were injured from the flying debris and were taken to the hospital for minor cuts.  Traffic lights were damaged on Jefferson Avenue south of I-64.",
    "Location": "MISSOURI"
  }
}

