  "Details": {
    "Description": "The dry weather continued in April, but there was some limited short-term relief. A few locations tallied near normal rainfall for the month, including Courtland and the north side of Huntsville. The southern and western portions of north Alabama, did not fare so well, with rainfall deficits of two to four inches for the month. Many locations increased their 2007 precipitation deficits to between eleven and thirteen inches of precipitation. Virtually the entire region spent much or all of April in the D3 status (Extreme Drought) on the U.S. Drought Monitor. Impacts were reported from across the area by agricultural interests. A late season freeze on April 7th and 8th added to the agricultural stress as well.",
    "Location": "ALABAMA"
  }
}

